import React, { Component } from 'react';
import Col from 'react-bootstrap/Col';
import _ from 'underscore';

class Event extends Component {
	render() {
		return (
			<Col className="card mb-3" sm={6} md={3} location={ this.props.meta.location }>
				<div className="card-body">
					<h5 className="card-title">{ this.props.meta.name }</h5>
				</div>
				<img width="100%" height="200px" display="block" src={ this.props.meta.pictures } alt={ this.props.meta.title } />
				<div className="card-body">
    				<p className="card-text left">{ this.props.meta.notes }</p>
  				</div>
  				<div className="card-body">
				    <a href={ this.props.meta.website } target="_blank" className="card-link">Website</a>
				</div>
			</Col>
		);
	}
}

export default Event;
